import React from "react";

function ImageAndText(
  className,
  
  headingClass,
  heading,
  section,
  sectionClass,
  source,
  imgClass
) {
  return (
    <div className={className}>
     <div className={wrapper}>
     <h1 className={headingClass}>{heading}</h1>
      <section className={sectionClass}>{section}</section>
     </div>
      {source !== null ? <img src={source} className={imgClass} /> : ""}
    </div>
  );
}

export default ImageAndText;
